from django.db import modelsfrom apps.account.models import Accountfrom apps.warehouse.models import ItemsModelclass ExpenseModel(models.Model):    receiver = models.ForeignKey(Account, on_delete=models.SET_NULL, null=True, related_name="expenses")    created_by = models.ForeignKey(Account, related_name="w_expense_creates", on_delete=models.SET_NULL,                                   null=True)    created_at = models.DateTimeField(auto_now_add=True)    modified_at = models.DateTimeField(auto_now=True)    modified_by = models.ForeignKey(Account, related_name="w_expense_mod", on_delete=models.SET_NULL, null=True)class ExpenseItemsModel(models.Model):    item = models.ForeignKey(ItemsModel, on_delete=models.CASCADE)    expense = models.ForeignKey(ExpenseModel, on_delete=models.CASCADE)    quantity = models.IntegerField(default=1)    created_by = models.ForeignKey(Account, related_name="w_expense_items_creates", on_delete=models.SET_NULL, null=True)    created_at = models.DateTimeField(auto_now_add=True)    modified_at = models.DateTimeField(auto_now=True)    modified_by = models.ForeignKey(Account, related_name="w_expense_items_mod", on_delete=models.SET_NULL, null=True)